import React from 'react'
import { Pressable } from "react-native";
import { styled } from "nativewind";

const MoreInfoPressable = styled(Pressable);


function Pressables( {onPress, className} ) {

  return (
    <MoreInfoPressable className={className} onPress={onPress}><Text>More Info:</Text></MoreInfoPressable>

  )
}

export default Pressables
